import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import axios from 'axios';

// Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';

// Pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './pages/Profile';
import QuizList from './pages/QuizList';
import QuizDetail from './pages/QuizDetail';
import TakeQuiz from './pages/TakeQuiz';
import QuizResults from './pages/QuizResults';
import QuizHistory from './pages/QuizHistory';

// Context
import { AuthProvider } from './context/AuthContext';

// Set up axios defaults - Version optimisée pour la production
const API_URL = process.env.NODE_ENV === 'production' 
  ? 'https://quizapp-xqwn.onrender.com/api'  // URL directe du backend
  : 'http://localhost:8000/api';

// Configuration d'axios
axios.defaults.baseURL = API_URL;
axios.defaults.headers.common['Content-Type'] = 'application/json';
axios.defaults.headers.common['Accept'] = 'application/json';

// Désactiver withCredentials pour éviter les problèmes CORS en production
axios.defaults.withCredentials = false;

// Ajouter des en-têtes CORS pour la production
if (process.env.NODE_ENV === 'production') {
  axios.defaults.headers.common['Access-Control-Allow-Origin'] = '*';
}

console.log('API URL:', API_URL);

// Ajouter un intercepteur pour les erreurs
axios.interceptors.response.use(
  response => response,
  error => {
    console.error('Erreur API:', error.response?.data || error.message);
    return Promise.reject(error);
  }
);

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen">
          <Navbar />
          <main className="flex-grow container mx-auto px-4 py-8">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/profile" element={
                <PrivateRoute>
                  <Profile />
                </PrivateRoute>
              } />
              <Route path="/quizzes" element={
                <PrivateRoute>
                  <QuizList />
                </PrivateRoute>
              } />
              <Route path="/quizzes/:quizId" element={
                <PrivateRoute>
                  <QuizDetail />
                </PrivateRoute>
              } />
              <Route path="/take-quiz/:quizId" element={
                <PrivateRoute>
                  <TakeQuiz />
                </PrivateRoute>
              } />
              <Route path="/quiz-results/:attemptId" element={
                <PrivateRoute>
                  <QuizResults />
                </PrivateRoute>
              } />
              <Route path="/history" element={
                <PrivateRoute>
                  <QuizHistory />
                </PrivateRoute>
              } />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

// Private route component
function PrivateRoute({ children }) {
  const { isAuthenticated, loading } = React.useContext(AuthProvider.context);

  if (loading) {
    return <div className="flex justify-center items-center h-64">
      <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-primary-500"></div>
    </div>;
  }

  return isAuthenticated ? children : <Navigate to="/login" />;
}

export default App;
